import networkx as nx
import numpy as np
import matplotlib.pyplot as plt


def read_G(filename):
    n = np.loadtxt(filename, dtype=float)
    G = nx.from_numpy_matrix(n)
    return G


def draw_graph(G, imagename):
    pos = nx.circular_layout(G)
    print(pos)
    #     print(pos1)
    #     pos = dict()
    #     for i in range(31, -1, -1):
    #       pos[i] = pos1[i]
    #     print(pos)
    plt.figure(figsize=(7, 7))
    nx.draw(G, pos, width=1.8, node_size=600)
    #     # if you need to label the nodes
    #     x = list(G.nodes())
    #     # x.reverse()
    #     # print(x)
    labels = dict(zip(G.nodes(), [str(x) for x in G.nodes()]))
    #     print(labels)
    nx.draw_networkx_labels(G, pos, labels, font_color="whitesmoke", font_family='Times New Roman', font_size=14, font_weight="bold")
    plt.draw()
    plt.savefig(imagename)
    plt.clf()


G = read_G("hey.txt")
nodes = list(G.nodes(data=True))
edges = list(G.edges(data=True))

nodes.reverse()
edges.reverse()
